                String query = t._1;
                String[] data = t._2;
                long count = data.length;
                long hit = 0;
                for (String[] d : data) {
                    if (d[1].equals(query)) {
                        hit++;
                    }
                }
                double hitRate = (double) hit / count;
                return new Tuple2<>(query, hitRate);
            }
        });

        // Save hit rate
        hitRate.saveAsTextFile("hit_rate.txt");

        sc.stop();
    }
}
