function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 7 / 8);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 7 / 8, (entity.id << 3) | entity.size);
    }
    return buffer;
